Here is a simple script that denies access to a website or service:

```
<?php
  // Check if the user is logged in
  if (!isset($_SESSION['user_id'])) {
    header("Location: login.php");
    exit;
  }

  // Check if the user has permission to access the website
  if (!isset($_SESSION['access_level']) || $_SESSION['access_level']!= 'admin') {
    header("Location: denied.php");
    exit;
  }

  // Check if the user has the required permissions
  if (!isset($_SESSION['required_permissions']) ||!in_array($_SESSION['required_permissions'], $required_permissions)) {
    header("Location: denied.php");
    exit;
  }

  // If all checks pass, allow access
  header("Location: allowed.php");
  exit;
?>
```

This script checks if the user is logged in, has the required access level, and has the required permissions. If all checks pass, it redirects the user to the `allowed.php` page. If any of the checks fail, it redirects the user to the `denied.php` page.

